subSubSection.paragraph:
Pelvic fins narrow and elongate, their length 8.6 %– 12.4 % TL anterior margin; slightly convex and posterior margin straight; apex and free rear tips rounded, the latter lobe-like; origin of pelvic fins 1.8 ( 1.5 –2.0) times distance between origins of the two dorsal fins, nearest to second dorsal fin (in young specimens, nearest to first dorsal fin); pectoral-pelvic distance 1.0 ( 0.6–1.3 ) times pelvic-caudal distance, usually equal in adults. Clasper cylindrical, compressed dorsoventrally throughout its extension, greatly extended beyond free rear tips of pelvic fin, its outer length 1.1 %– 5.8 % TL; siphon large, located medioventrally from the anteriormost end of puboischiadic bar level of intermediate cartilage; clasper groove longitudinal and dorsomedially, sinuous and deep; apopyle broad, placed more anteriorly in clasper groove; hypopyle narrow, located posteriorly to rhipidion; rhipidion elongate, blade-like, located medially at distal end of clasper (
Fig. 5
).

