subSubSection.paragraph:
Dermal denticles (
Fig. 7
). Denticles unicuspid, their length and width equivalent, relatively sparsely positioned, not imbricated; median ridge pronounced, elongate and narrow, projecting anteriorly beyond crown base; median cusp pointed posteriorly. In neonates, denticles smaller, markedly sparse and underdeveloped throughout body.

Coloration ( Figs. 2 , 6 ). Body dark gray dorsal and laterally, and light gray more posteriorly from the lower lateral half of the body just in front of the pectoral fin origin to the caudal fin; white ventrally; large and few paired white spots dorsolaterally, usually anterior to second dorsal fin. Both dorsal fins dark gray with apex slightly darker at tip than rest of fin, white at fin base and on free rear tips; dorsal-fin spines dark gray to brownish anteriorly and whitish at tips. Pectoral fins also dark gray dorsoventrally with both inner and posterior margins broadly whitish. Pelvic fins gray dorsally and ventrally, lighter ventrally, with anterior and posterior margins evidently white. Caudal fin gray, darker at posterior tip, slightly white at dorsal caudal margin, forming a white caudal bar; black caudal stripe strong and wide, dorsal to vertebral column on caudal fin; postventral caudal margins discreetly white; preventral caudal margin white, including at ventral tip (
Fig. 2
). In young specimens (between 200–330 mm TL), body usually light gray with numerous white spots, often fused (
Fig. 6
); dorsal fins markedly darker at tip; caudal fin conspicuously dark gray with broad white caudal bar at dorsal caudal margin; black upper caudal blotch near the terminal region from vertebral column to posterior caudal tip; preventral and postventral margins largely white.

Neurocranium (
Fig. 8
). Neurocranium greatest width at level of postorbital processes (50.0%– 53.4 % CL), narrower at interorbital region ( 28.5 %– 31.8 % CL) and between the opisthotic processes in the otic region ( 32.6 %– 35.5 % CL). Rostrum elongate (its length 36.0%– 42.3 % CL), slender proximal and distally, and wide medially, its width 11.5 %– 16.9 % CL; lateral rostral cartilages cylindrical, somewhat depressed anteriorly; ventrally, two lateral rostral appendices thick and hook-like; median rostral prominence small; rostral keel conspicuous and well elongate, extending anterior to nasal capsules (its length 21.9 %– 26.1 % CL). Prefrontal fontanelle rounded, located at base of rostrum and anterior to cerebrum. Nasal capsules oval and strongly oblique, very narrow, width across nasal capsules 44.0%– 48.7 % CL; small fissures evident ventrally on nasal capsules (not shown); anterior nasal margin with a unique cartilaginous lobe; subnasal fossa oval and large, located ventrally on each side of rostral keel.

