subSubSection.paragraph:
Pelvic fin and girdle (
Fig. 11
). Pelvic girdle with puboichiadic bar rectangular, short and slightly slender, with anterior margin somewhat straight and posterior margin convex; two conspicuous expansions posteriorly articulate puboischiadic bar to the basipterygium and to the anterior pelvic fin element; a single pelvic nerve foramen present at each side of pubosichiadic bar. Anterior pelvic fin basal element subrectangular and wide with three series of irregular and small radials; basipterygium elongate markedly slender, cylindrical and sinuous; pelvic radials thin and large, cylindrical, and segmented into proximal and distal elements, the former much larger; 14 total pelvic radials.

Claspers (
Fig. 12
). Intermediate element barrel-shaped, attaching pelvic fin basipterygium to axial cartilage; beta cartilage single, slender and cylindrical, located laterodorsally between intermediate element and axial cartilage; axial cartilage small, slender, conspicuously sinuous medioproximally; end-style elongate and thin, mediodistal to axial cartilage; dorsal marginal cartilage slim, located dorsolaterally to axial cartilage; dorsal terminal cartilage conspicuously elongate, not reaching distal end of clasper, hook-like, connected proximally to dorsal marginal cartilage and axial cartilage, and medially to end-style; dorsal terminal 2 cartilage leaf-like and flattened, also elongate, with concave lateral margin, attached medially to dorsal terminal cartilage, and proximally to dorsal marginal cartilage, externally supporting the rhipidion; ventral marginal cartilage slightly thick and broad, concave and grooved laterally at its inner side, emerging as a folded plate at insertion of accessory terminal cartilage; ventral terminal cartilage also large, slender and spatula-like with rounded distal tip somewhat sinuous laterally, located at distal end of clasper, and attached proximally to ventral marginal cartilage and medially to endstyle; accessory terminal 3 cartilage (or spur) markedly slim and elongate with an evident dorsal groove, distally pointed, with a rounded proximal edge, partially attached to ventral margin and ventral terminal cartilages.

