subSubSection.paragraph:
Vertebral counts (
Table 2
). Monospondylous vertebrae with mode value 44 ( 43–47 ); diplospondylous vertebrae 61 ( 57–63 ); precaudal vertebrae 75 ( 75–81 ); total vertebrae 101 ( 101–109 ).

This species also has a worldwide distribution and exhibits varying patterns of its biological functions such as reproduction and growth, distribution and abundance, and populational structure (
Gallucci et al ., 2009
;
Ebert et al ., 2013
). Thus, it is commonly considered a polytypic species or a complex of cryptic species or populations, supported by morphological and molecular data, which have allowed for the recognition of new species (
Myagkov & Kondyurin, 1986
;
Veríssimo et al ., 2010
; White & Last, 2012 ).

The taxonomy of
S. acanthias
is not yet completely clarified due to the morphological and molecular variation between specimens from different localities worldwide (e.g. Bigelow & Schroeder, 1948 , 1957 ;
Springer & Garrick, 1964
;
Bass et al ., 1976
;
Ward et al. , 2007
). Our results corroborate these studies from a morphological standpoint, despite that external measurements mostly overlap between specimens of
S. acanthias
from SWAO and other localities, indicating that they appear to be conspecific (
Table 4
). Specimens of
S. acanthias
share the following characteristics (
Table 2
): anterior margin of the nostrils with a simple lobe, not bifurcated when adults;
14 – 1–14
teeth in the upper jaw and
12 – 1–12
in the lower jaw; first dorsal-fin spine located posterior to the free rear tips of the pectoral fins; unicuspid dermal denticles without lateral expansions; presence of white spots on dorsum.

Squalus suckleyi (Girard, 1854 )
from the Northwest Pacific Ocean has also been considered a junior synonym of
S. acanthias
(e.g. Bigelow & Schroeder, 1948 , 1957 ;
Compagno, 1984
), but which has been recently resurrected as valid (
Ebert et al ., 2010
). Molecular analysis (e.g.
Ward et al ., 2007
;
Veríssimo et al ., 2010
) strongly support its separation, despite the fact that mostly overlapping morphological characters were used to distinguish this species from
S. acanthias
(e.g.
Jordan & Evermann, 1896
;
Regan, 1908
;
Garman , 1913
;
Ebert et al ., 2010
), such as a less obtuse snout, the position of the first dorsal-fin spine located right after the free rear tip of the pectoral fin, pelvic fins located slightly closer to the second dorsal fin than to the first dorsal fin, and a smaller number of total vertebrae. These differences, however, were not observed by us with exception of the position of the first dorsal spine in relation to the pectoral fin. Other morphological characters are still needed to better distinguish
S. suckleyi
from
S. acanthias
.
